import React, { useState } from "react";

export const Navbar = props => {
    const [section, setSection] = useState(1);
    return (
        <header className="w-100 position-fixed shadow">
            <nav className="navbar navbar-expand-lg py-0 px-4">
            <button 
                className="navbar-toggler border my-2 ms-auto"
                type="button"
                data-bs-toggle="collapse"
                data-bs-target="#navbarNav"
                aria-controls="navbarNav"
                aria-expanded="false"
                aria-label="Toggle navigation">
                <i className="bi bi-list fs-2"/>
            </button>
            <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
                <ul className="navbar-nav">
                {
                    props.nav.map(
                    (n, i) =>
                    <li className="nav-item" key={i}>
                        <a 
                        href={"#section-" + (i + 1)} 
                        className={section === i ? "nav-link px-2 active" : "nav-link px-2"}
                        onClick={() => setSection(i)} 
                        key={i}>
                            {n}
                        </a>
                    </li>
                    )
                    }
                </ul>
            </div>
            </nav>
        </header>
    )
}
